import React, {Component} from 'react'


class DogsList extends Component {

    render() {
        const {list} = this.props;
        const listOfDogs = list.map((dogName) => {
            <li>
            {dogName}
          </li>
        });

        return (
            <div>
                {listOfDogs}

            </div>
        )
    }

}

export default DogsList;
